xyb='<div class="_GAdk"><div class="_GAfk"><h2 class="_GAQj">Our Data Hub Partners</h2>',yyb='<div class="_GAdk"><div class="_GAfk"><h2 class="_GAQj">The Social Relationship</h2><p>The social web connects people where they share, critique and interact with content and each other. Social analytics provides you with the tools to measure the impact of social. You can identify high value networks and content, track on-site and off-site user interaction with your content, and tie it all back to your bottom line revenue through goals and conversions.</p><p>Here\'s how we see this story:</p><p><b>Sources &amp; Pages:</b> Identify networks &amp; communities where people engage with your content.</p><p><b>Conversions:</b> Measure the value of social by tracking your goals, conversions and ecommerce transactions.</p><p><b>Social Plugins:</b> Measure your on-site user engagement.</p><p><b>Social Users Flow:</b> Compare traffic volumes and user traffic patterns through your site.</p></div></div>',
