IRb='<ol class="ID-ruleContainer"></ol>',JRb='<ol class="_GASmb">',KRb="<option value=",je='<option value="',LRb='<option value="1000" ',MRb="<option value='",NRb='<p class="_GAANb">',ORb='<p class="_GAEEb">',PRb='<p class="_GAFeb">',QRb='<p class="_GAHNb">Description unavailable.</p>',RRb='<p class="_GAIG">',SRb='<p class="_GAJlb">',TRb='<p class="_GAKb">',URb='<p class="_GAKb">Click <strong>Transfer</strong> to transfer this property to the Universal Analytics processing technology. <em>This is the only action you need to take to complete this step.</em></p><p class="_GAKb">Google Analytics will take 24 - 48 hours to complete the transfer.<br><em>To ensure you continue to collect high quality data, don\u2019t make any changes to your tracking code until the transfer is complete.</em></p><p class="_GAKb">After the transfer is complete, any data you collect using the old tracking code (<em>ga.js</em>) will be processed using the Universal Analytics technology. To get all the benefits of Universal Analytics, implement the new tracking code (<em>analytics.js</em>).</p><p class="_GAKb">Any data collected before the transfer will be saved, and will still be available in your reports.</p>',
VRb='<p class="_GAKb">Create a User-ID view to analyze data from sessions in which a User-ID is detected. This view includes a set of Cross-Device reports that let you see user engagement data from different devices over the course of multiple sessions.<br><br>A User-ID view is filtered. All reports in this view display data from sessions in which a User-ID is detected. Use a different view to see data from sessions in which a User-ID is not detected.<br><br>To create a new User-ID view, use the standard process for creating a new view in your account. Click <em>Create</em> to leave this flow and start that process.</p>',
WRb='<p class="_GAKb">Setting up the User-ID requires a change to your tracking code and should be completed by a developer. Learn more about the User-ID.</p><div class="_GAisb"><strong>',XRb='<p class="_GAKb">This is the Universal Analytics tracking code for this property. It\u2019s different from the classic Google Analytics tracking code. <strong>To get all the benefits of Universal Analytics for this property, copy and paste this code into every webpage you want to track.</strong></p>',YRb='<p class="_GAKb">This is the Universal Analytics tracking code for this property.<br>To get all the benefits of Universal Analytics for this property, copy and paste this code into every webpage you want to track.</p>',
ZRb='<p class="_GAKb">This property works using Universal Analytics. Click <em>Get Tracking ID</em> and implement the Universal Analytics tracking code snippet to complete your set up.</p></div>',$Rb='<p class="_GAKb">Universal Analytics is the new operating standard for Google Analytics. When you upgrade, you can still access all of your historical data in the same reports you use today, but you also get:</p><ul><li class="_GAKb">Custom Dimensions and Metrics</li><li class="_GAKb">New Tracking Code</li><li class="_GAKb">More Reporting Features</li></ul><p class="_GAKb">All Google Analytics properties will soon be required to use Universal Analytics. Properties that aren\u2019t transferred will be auto-transferred to Universal Analytics in the future.</p>',
