y9c="SelectedCount-",z9c="SelectedStatusCircle-",A9c="Self-Referrals",B9c='Self-referrals are referrals from pages within your own domains. Self-referrals can obscure the actual sources of traffic to which conversions and other engagement on your site should be attributed. As a result, your referral metrics could be inaccurate. Further, self-referrals could be indicative of improperly-configured cross-domain tagging. Your users could be generating a session per domain, which would artificially inflate session counts.<br><br>There are multiple different Analytics misconfigurations that can cause self-referrals. Users navigating from an untagged page on your site to a tagged page can appear as self-referrals. Users navigating from one subdomain on your site to another subdomain that uses a different cookie domain can appear as self-referrals. If you track multiple domains in one web property, users navigating across multiple domains on your site without linker parameters set up to transfer cookie information properly can appear as self-referrals.<br><br>To avoid self-referrals, ensure all pages on your site are correctly tagged with the Analytics tracking code, make sure that cross-domain tracking is configured correctly on all your pages, and check your cookie domain settings in your tracking code to be sure that all subdomains in a domain are using the same cookie domain.<br><br><a href="https://analytics.google.com/tagrecordings/notificationlink?utm_source=google.com&utm_medium=notif_referral&utm_campaign=RECEIVING_SELF_REFERRALS" target="_blank">Google Tag Assistant Recordings</a> can help you determine where your self referrals might be happening.',
