q7f=N(p7f),r7f=g,r7f=r7f+"<p>Use this to filter traffic for a specific campaign target URL. Common use cases for this filter are listed below:<br>AdWords users: Campaign Target URL is the 'Destination URL' for the ad with any optional campaign tags.</p><ul><li>www\\.mycompany\\.com\\\\purchase_page\\.html\\?cmpg\\=25off - This filters all traffic for campaign with a target URL of 'www.mycompany.com\\purchase_page.html?cmpg=25off'.</li><li>15off - This filters all traffic for campaign with a target URL containing '15off' anywhere in the URL.</li><li>\\.[US|UK]- This filters all traffic with target URL specificly pointed to US or UK locations.</li></ul>",
s7f=N(r7f),t7f=g,t7f=t7f+"<p>A common use case for this filter is to include or exclude only traffic mentioning a subdirectory, e.g. 'mysubdirectory'. To create this filter, simply enter this into the 'Filter Pattern' field: /mysubdirectory/</p><p>Below are some more examples for this filter type:</p><ul><li>^/mysubdirectory: Include only traffic to a specific top level directory</li><li>/es/ or ^/es/: Include only the bottom level directory (e.g. you only want to look at Spanish pages on the site example.com/topleveldirectory/es/newsletters.html)</li></ul>",
O3=N(t7f),u7f=g,u7f=u7f+"<p>Note: Replace string is either a regular string or it can refer to group patterns in the search expression using backslash-escaped single digits like (\\0 to \\9). If you want to have backslash('\\') in the replacement string you must use double backslashes ('\\\\') instead.<br>A common use case for the Search and Replace filter is to turn multiple URLs into one. For example, to merge 'example.com/article/CA/planning+your+trip.html' and 'example.com/article/NY/exploring+the+country.html' so that your reports for the profiles for which you will apply this filter will show 'example.com/article/', please follow these steps:</p><ol><li>Search String: example\\.com/article/.*</li><li>Replace String: example\\.com/article/</li></ol>",
v7f=N(u7f),w7f=g,w7f=w7f+"<p>Google Analytics is case sensitive, so it captures the data exactly as it appears in the location bar of the browser. Therefore, if a mixed case URL is in the browser, it will be captured and displayed as mixed case within your Google Analytics reports. You can use the lowercase filter to change URLs like '/Thankyou.html' and '/ThankYou.html' into one unified URL in your reports: '/thankyou.html'. The uppercase filter can transform these same URLs into '/THANKYOU.HTML'.</p>",
x7f=N(w7f),y7f=g,y7f=y7f+"<p>You can use advanced filters to reorder URLs, like the below link for instance: <br/>&nbsp;&nbsp;&nbsp; From: http://www.mysite.com/shopping?qsrc=35&amp;o=0&amp;x=ref&amp;stf=CA:LO&amp;q=lava+lamp<br/>&nbsp;&nbsp;&nbsp; To: /shopping/o=0/qsrc=35/q=lava+lamp<br/></p><p>Click 'Next' if you want us to guide you through the four steps that you'd need to create an advanced filter for URL reordering. Note that each step represents one filter. They need to be created in that order for their combined behavior to perform the re-ordering action described above.</p>",
